let cks = 0;
let buffer = Buffer.from(msg.payload,'hex');
let conversion = "";
let i = 0;

// Convert to readable NEC Hexa format identical to the manual
for (i = 0; i < buffer.length - 1; i++) {
    // final space will be removed at the end
    conversion += buffer[i].toString(16).padStart(2,'0').toUpperCase() + "H ";
    cks += buffer[i];
  }

// Checksum recomputation for safety
let checksum = cks % 256;

msg.checksum_expected = "0x" + checksum.toString(16).padStart(2,'0');
msg.checksum_received = "0x" + buffer[i].toString(16).padStart(2,'0');

if(checksum == buffer[i]) {
    msg.checksum = "CORRECT";
}
else {
    msg.checksum_status = "WRONG";
}

// ACK or NAK
// First byte in 2* is success (0010****b)
// First byte in A* is failure (1010****b)
// Masking on the first 2 bits = 11000000b = 0xc0
let response = buffer[0] & 0xc0;

switch(response)
{
    case 0x00:
    msg.response = "ACK";
    break;

    case 0x80:
    msg.response = "NAK";
    break;
}

msg.ascii = conversion.slice(0, -1);
return msg;

switch(msg.payload.DATA01_Error_Type)
{
    case 0x0:
    msg.payload.DATA01_Error_Type_Txt = "Not supported";
    switch(msg.payload.DATA02_Error_Description)
