            msg.payload.DATA02_Error_Description_Txt = "This model is not compatible with the PC Viewer";
            break;
    }
    break;
    case 0x1:
    msg.payload.DATA01_Error_Type_Txt = "Parameter error";
    switch(msg.payload.DATA02_Error_Description)
    {
        case 0x0:
            msg.payload.DATA02_Error_Description_Txt = "Unvalid values specified";
            break;
        case 0x1:
            msg.payload.DATA02_Error_Description_Txt = "Specified terminal is unavailable or cannot be selected";
            break;
        case 0x2:
            msg.payload.DATA02_Error_Description_Txt = "Selected language is not available";
            break;
    }
    break;
    case 0x2:
    msg.payload.DATA01_Error_Type_Txt = "Operation mode error";
    switch (msg.payload.DATA02_Error_Description)
    {
        case 0x0:
            msg.payload.DATA02_Error_Description_Txt = "Available memory reservation error";
            break;
        case 0x1:
            msg.payload.DATA02_Error_Description_Txt = "External control working";
            break;
        case 0x2:
            msg.payload.DATA02_Error_Description_Txt = "Operating memory";
            break;
        case 0x3:
            msg.payload.DATA02_Error_Description_Txt = "Standby";
            break;
        case 0x4:
            msg.payload.DATA02_Error_Description_Txt = "On Forced on-screen mute mode";
            break;
        case 0x5:
            msg.payload.DATA02_Error_Description_Txt = "Link mode working";
            break;
        case 0x6:
            msg.payload.DATA02_Error_Description_Txt = "Displaying a signal other than PC Viewer";
            break;
        case 0x7:
            msg.payload.DATA02_Error_Description_Txt = "- No Signal -";
            break;
        case 0x8:
            msg.payload.DATA02_Error_Description_Txt = "Displaying a test pattern of PC Card Files screen";
            break;
        case 0x9:
            msg.payload.DATA02_Error_Description_Txt = "No PC Card is inserted";
            break;
        case 0xa:
            msg.payload.DATA02_Error_Description_Txt = "Memory operation failed";
            break;
        case 0xb:
            msg.payload.DATA02_Error_Description_Txt = "Switcher mode working";
            break;
        case 0xc:
            msg.payload.DATA02_Error_Description_Txt = "Displaying the Entry List";
            break;
    } 
    break;
    case 0x3:
    msg.payload.DATA01_Error_Type_Txt = "Gain-related error";
    switch (msg.payload.DATA02_Error_Description) {
        case 0x0:
            msg.payload.DATA02_Error_Description_Txt = "Group number / sub category number is not correct";
            break;
        case 0x1:
            msg.payload.DATA02_Error_Description_Txt = "Selected gain is not available";
            break;
        case 0x2:
            msg.payload.DATA02_Error_Description_Txt = "Adjustment failed";
            break;
        }
    break;
    case 0x4:
    msg.payload.DATA01_Error_Type_Txt = ":pgp transfer error";
    switch (msg.payload.DATA02_Error_Description) {
        case 0x0:
            msg.payload.DATA02_Error_Description_Txt = "Start is not requested";
            break;
        case 0x1:
            msg.payload.DATA02_Error_Description_Txt = "Cannot process due to storing";
            break;
        case 0x2:
            msg.payload.DATA02_Error_Description_Txt = "Exceeds the total number of blocks required";
            break;
    }
    break;

}
return msg;
